// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface IDContratoD {
    function setFee(uint256 _fee) external;
    function getFee() external view returns (uint256);
}

contract ContratoA {
    address payable public contratoB;
    address public contratoD;
    uint256 public fee;
    
    constructor(address _contratoB, address _contratoD) {
        contratoB = payable(_contratoB);
        contratoD = _contratoD;
    }

    // Recibir Ether de Contrato C
    receive() external payable {}

    // Establecer Fee usando la función del contrato D
   /* function setFeeFromContratoD(uint256 _fee) external {
        IDContratoD(contratoD).setFee(_fee);
    }
*/
    // Función que verifica la Fee y envía Ether al contrato B si es válido
    function enviarAEtherAlContratoB(uint256 cantidadAEnviar_) external {
        uint256 currentFee = IDContratoD(contratoD).getFee();
        
        require(currentFee <= 5, "La Fee es mayor a 5, no se puede enviar Ether.");

        uint256 balanceA = address(this).balance;
        
        // Calcular la cantidad de Ether que se enviará al contrato B
        //uint256 cantidadAEnviar;  // Enviar solo la mitad del balance, o ajusta esto según tu necesidad

        // Usar transfer() para enviar Ether al contrato B
        contratoB.transfer(cantidadAEnviar_);
        
        // Verificar que el saldo de A haya disminuido
        require(address(this).balance == balanceA - cantidadAEnviar_, "El saldo de A no se redujo correctamente.");
    }

//retirar ether
    function withdrawEther(uint256 amount_) public {
        //recipient + .call + {value: ether value} + data

        (bool success, )= msg.sender.call{value: amount_}("");
        require(success, "Transfer failed");

    }
}

